CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "Profile_tenantprofile" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "full_name" varchar(191) NULL, "phone_number" varchar(191) NULL, "user_picture" varchar(100) NOT NULL, "timestamp" datetime NOT NULL, "user_id" integer NOT NULL UNIQUE REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED);
