CREATE TABLE IF NOT EXISTS "landloard_landlordprofile" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "hostel_name" varchar(191) NOT NULL, "hostel_location" varchar(191) NULL, "your_full_name" varchar(191) NULL, "your_phone_number" varchar(191) NULL, "your_picture" varchar(100) NOT NULL, "timestamp" datetime NOT NULL, "user_id" integer NOT NULL UNIQUE REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "landloard_hostelcontact" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "hostel_phone_number" varchar(20) NOT NULL, "hostel_mail" varchar(254) NOT NULL, "payment_method" varchar(191) NULL, "hostel_address" text NOT NULL, "hostel_name_id" integer NOT NULL REFERENCES "landloard_landlordprofile" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "landloard_hostelgallary" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "photo_description" text NOT NULL, "photo" varchar(100) NOT NULL, "hostel_name_id" integer NOT NULL REFERENCES "landloard_landlordprofile" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "landloard_hostelhomepage" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "welcoming_message" text NOT NULL, "background_image" varchar(100) NOT NULL, "hostel_name_id" integer NOT NULL REFERENCES "landloard_landlordprofile" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "landloard_hostelplan" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "single_room_desc" text NOT NULL, "double_room_desc" text NOT NULL, "self_contained" text NOT NULL, "hostel_name_id" integer NOT NULL REFERENCES "landloard_landlordprofile" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "landloard_hostelservice" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "security" text NOT NULL, "water_supply" text NOT NULL, "power_supply" text NOT NULL, "bed_size" text NOT NULL, "room_size" text NOT NULL, "table_and_chair_availabitity" text NOT NULL, "hostel_name_id" integer NOT NULL REFERENCES "landloard_landlordprofile" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "Profile_paymentrequestheaders" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "merchant_request_id" varchar(100) NOT NULL, "checkout_request_id" varchar(100) NOT NULL, "response_description" varchar(100) NOT NULL, "hostel_name_id" integer NOT NULL REFERENCES "landloard_landlordprofile" ("id") DEFERRABLE INITIALLY DEFERRED, "phone_number_used_for_payment" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "Profile_roomateselection" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL UNIQUE REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "user_roomate_id" integer NOT NULL UNIQUE REFERENCES "Profile_tenantprofile" ("id") DEFERRABLE INITIALLY DEFERRED);
